import Grid from '@material-ui/core/Grid';
import React from 'react';
import DashboardV from './src/Dashboard';
import HeaderV from './src/Header';
import LineChartV from './src/LineChart';
import RadarChartV from './src/RadarChart';

function App() {
  return (
    <Grid container style={{backgroundColor:'#eee'}}>
      <HeaderV/>
      <Grid style={{display:'flex'}} >
        <Grid >
        <DashboardV/>
        </Grid>

        <Grid style={{display:'flex',flexDirection:'column'}}>

          <Grid style={{display:'flex'}}>

      <Grid style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </Grid>

     <Grid style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
       <RadarChartV/>
     </Grid>

     </Grid>

     <Grid style={{display:'flex'}}>

      <Grid style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </Grid>

      <Grid style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </Grid>

      </Grid>

      </Grid>

    </Grid>

</Grid>


  );
}

export default App;
